INSERT INTO `block_custom` VALUES (1,'<h2 class=\"alt\">Welcome to Seven, a beautifull Drupal 7 Responsive HTML5 &amp; CSS3 Theme for your Business, Agency, Freelance, Corporate or digital Portfolio. It\'s 99% ready. The only thing left here, is your own content.</h2>','Seven - Welcome Block','full_html'),(5,'Ut consectetur ullamcorper purus a rutrum. aenean dictum vulputate porta. nunc sed mi arcu. in semper consectetur quam nec tristique. in consequat massa eget dui ultrices sit amet auctor libero molestie. nullam rutrum convallis lacus non mattis. nam enim libero, lacinia a tristique a, accumsan sed purus. curabitur lorem orci.','Product Portfolio Intro','filtered_html'),(7,'<p>Copyright 2012. Emerging Firms, Inc.&nbsp;&nbsp;<a class=\"link-top right\" href=\"#\">Back to Top</a></p>\r\n<p><a class=\"link-top top-link-block\" href=\"#\">Back to Top</a></p>\r\n','Copyright Block','full_html'),(8,'<p>info@emergingfirms.com</p>\r\n<p>Headquarters:</p>\r\n<p>5405 Morehouse Drive, Suite 327</p>\r\n<p>San Diego, California &nbsp;92121</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;<strong>Contact Form</strong>.</p>\r\n','Contact Emerging Firms at:','filtered_html'),(9,'<p><a href=\"/NewDrup/?q=user\">LOGIN</a></p>\r\n','Login link','filtered_html');
